import React, { Component } from 'react';
/*import logo from './logo.svg';*/
import './App.css';
import Empl from  './components/employee_details'
import EMPL_LIST from './components/employee_list_tab'
import { Navbar, NavbarBrand, Nav, NavItem, NavLink,TabContent,TabPane,Row,Col} from "reactstrap";
import classnames from 'classnames'
import CompRouter from './Routes/route'
import EmployeeMasterRoute from './Routes/EmployeeMasterRoute'
import EmployeeMaster from './components/EmployeeMaster';
import EmployeeMasterNew from './components/EmployeeMasterNew'
//#e77457
class App extends Component {
    constructor(props){
        super(props)
        this.toggle =  this.toggle.bind(this)
        this.state = {
            activeTab : '1'
        }
    }
    toggle(tab){
        if(this.state.activeTab !== tab) {
            this.setState({activeTab: tab})
        }
    }
  render() {
    return (
        <div>

                    <NavbarBrand href = "/" className= "align-content-between m-2">Powerpay@v2</NavbarBrand>
                    <Nav className= "display-3" tabs>
                        <NavItem>
                            <NavLink className={classnames({active : this.state.activeTab === '1'})}  onClick={()=>this.toggle('1')}> Organisation Creation </NavLink>
                        </NavItem>
                        <NavItem>
                            <NavLink className={classnames({active : this.state.activeTab === '3'})} onClick={()=>this.toggle('3')}> Employee Creation </NavLink>
                        </NavItem>
                    </Nav>

            <TabContent className="p-3 m-3" activeTab={this.state.activeTab}>
                <TabPane className="tab-pane" tabId="1">
                          <CompRouter />
                </TabPane>
                <TabPane className="tab-pane" tabId="3">
                    <EmployeeMasterNew />
                </TabPane>
            </TabContent>
          </div>
    );
  }
}

export default App;
